import React from 'react';
import './profile.css'; // Import the CSS file for styling

const UserProfile = () => {
  const user = {
    name: 'John Doe',
    email: 'johndoe@example.com',
    image: 'https://example.com/profile-image.jpg',
    githubStats: {
      followers: 200,
      repos: 50,
    },
    sessionsAttended: 10,
    numOfBadges: 5,
    title: 'Merge Master',
  };

  return (
    <>
    <div className="profile-container">
      <div className="profile-header">
        <img src={user.image} alt="Profile" className="profile-image" />
        <h1 className="profile-name">{user.name}</h1>
        <p className="profile-email">{user.email}</p>
      </div>
      <div className="profile-stats">
        <p className="github-followers">Followers: {user.githubStats.followers}</p>
        <p className="github-repos">Repos: {user.githubStats.repos}</p>
      </div>
      <div className="profile-details">
        <p className="sessions-attended">Sessions Attended: {user.sessionsAttended}</p>
        <p className="num-of-badges">Number of Badges: {user.numOfBadges}</p>
        <p className="title">Title: {user.title}</p>
      </div>
    </div>
    </>
  );
};

export default UserProfile;
